import React from 'react';
import 'antd/dist/antd.css';

class Title extends React.Component {
    render() {
        return (
            <h1 className={"titleHome"}>Vehicle Accident Compensation System Based<br/>Based On Block Chain</h1>
        )
    }
}


export default Title;
